INSERT INTO `aiml` VALUES(43825, "<category><pattern>WHAT IS A PROTESTANT CHRISTIAN</pattern><template>A Protestant Christian is a member of any number of sects of contemporary Western Christianity whose faith and practice developed out of the 16TH century Protestant Reformation in Europe. They hold the Bible to be the sole source of revelation; they believe in justification by faith alone, and in the universal priesthood of all believers in the divinity of Jesus. <think> <set name=\"it\"> <set name=\"topic\"> PROTESTANT CHRISTIAN</set> </set> </think> </template></category>", "WHAT IS A PROTESTANT CHRISTIAN", "", "A Protestant Christian is a member of any number of sects of contemporary Western Christianity whose faith and practice developed out of the 16TH century Protestant Reformation in Europe. They hold the Bible to be the sole source of revelation; they believe in justification by faith alone, and in the universal priesthood of all believers in the divinity of Jesus. <think> <set name=\"it\"> <set name=\"topic\"> PROTESTANT CHRISTIAN</set> </set> </think> ", "", "Religion.aiml")
