INSERT INTO `aiml` VALUES(43827, "<category><pattern>WHAT IS BUDDHISM</pattern><template>A religion and philosophic system of central and eastern Asia, founded in India in the 6th century B.C. by Buddha. It teaches that right thinking and self-denial will enable the soul to reach Nirvana, a divine state of release from misdirected desire.</template></category>", "WHAT IS BUDDHISM", "", "A religion and philosophic system of central and eastern Asia, founded in India in the 6th century B.C. by Buddha. It teaches that right thinking and self-denial will enable the soul to reach Nirvana, a divine state of release from misdirected desire.", "", "Religion.aiml")
